import React from 'react';
import './CSS/Kapcsolat.css';

const Kapcsolat = () => {
  return (
    <div className='Kapcsolat'>
     <h1 >Elérhetőség</h1> 
      <h2>Ha kérdése van, vagy segítségre van szüksége, lépjen kapcsolatba velünk:</h2>
      <ul>
        <li> Email: pelda@etelrendeles.hu</li>
        <li> Telefon: +36 1 234 5678</li>
        <li> Cím:  1234 Budapest, Pelda utca 5.</li>
      </ul>
      
      <footer className='footer1'>
        <p>&copy; {new Date().getFullYear()} FoodRapid. Minden jog fenntartva.</p>
        <p>Kövess minket a közösségi médiában!</p>
      </footer>

    </div>
  )
}

export default Kapcsolat;
